__author__ = 'rob'

import unittest
from week1_library import skew_prefix

class TestSequenceFunctions(unittest.TestCase):

    def test_prefix_0(self):
        self.assertEqual([0], skew_prefix("A", 0))


    def test_prefix_not_c_or_g(self):
        self.assertEqual([0, 0], skew_prefix("A", 1))


    def test_prefix_c_at_position_1(self):
        self.assertEqual([0, -1], skew_prefix("C", 1))


    def test_prefix_g_at_position_1(self):
        self.assertEqual([0, 1], skew_prefix("G", 1))


    def test_multi_character(self):
        self.assertEqual([0, 1, 1], skew_prefix("GA", 2))


    def test_multi_character_first_not_CG(self):
        self.assertEqual([0, 0, 1], skew_prefix("TGA", 2))


    def test_longer_example(self):
        genome = "CATGGGCATCGGCCATACGCC"
        prefix = skew_prefix(genome, len(genome))
        self.assertEqual([0, -1, -1, -1, 0, 1, 2, 1, 1, 1, 0, 1, 2, 1, 0, 0, 0, 0, -1, 0, -1, -2], prefix)
        self.assertEqual("0 -1 -1 -1 0 1 2 1 1 1 0 1 2 1 0 0 0 0 -1 0 -1 -2", " ".join(map(str, prefix)))


    def test_submittal(self):
        self.assertEqual("0 1 1 2 1 0 0 -1 -2 -1 -2 -1 -1 -1 -1", " ".join(map(str, skew_prefix("GAGCCACCGCGATA", 14))))


    def test_minimum_skew(self):
        genome = "TAAAGACTGCCGAGAGGCCAACACGAGTGCTAGAACGAGGGGCGTAAACGCGGGTCCGAT"
        prefix = skew_prefix(genome, len(genome))
        print(prefix)
        min_skew = prefix[0]
        minimum_indices = list()
        for i, skew in enumerate(prefix):
            if skew < min_skew:
                min_skew = skew
                minimum_indices.clear()
                minimum_indices.append(i)
            elif skew == min_skew:
                minimum_indices.append(i)

        self.assertEqual("11 24", " ".join(map(str, minimum_indices)))


    def test_minimum_skew_submittal(self):
        genome = ""
        prefix = skew_prefix(genome, len(genome))
        print(prefix)
        min_skew = prefix[0]
        minimum_indices = list()
        for i, skew in enumerate(prefix):
            if skew < min_skew:
                min_skew = skew
                minimum_indices.clear()
                minimum_indices.append(i)
            elif skew == min_skew:
                minimum_indices.append(i)

        self.assertEqual("80896 80897 80898 80899 80900", " ".join(map(str, minimum_indices)))
